import { StatusBar } from "expo-status-bar";
import React, { useState, Component } from "react";
import AsyncStorage from "@react-native-async-storage/async-storage";
import {
  StyleSheet,
  Text,
  Image,
  TextInput,
  TouchableOpacity,
  SafeAreaView,
} from "react-native";

// We should document our code.
/**
 * Insert text at cursor position.
 *
 * @param {string} text
 * @public
 */
const LoginPage = ({ navigation }) => {
  const storeToken = async (token) => {
    /*
     *   Store the token in the local storage
     */
    try {
      await AsyncStorage.setItem("private_token", token);
    } catch (error) {
      console.log(error);
    }
  };

  const isValidEmail = (email) => {
    /*
     *   Check if the email is valid
     */
    return /\S+@\S+\.\S+/.test(email);
  };

  const cloud_url =
    "https://e6waofnzq8.execute-api.eu-central-1.amazonaws.com/main";

  // OLD URL
  // const cloud_url =
  //   "https://eurmpfph3wu5w7rmksrgt46b5q0prnws.lambda-url.eu-central-1.on.aws";

  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  /**
   * FUNCTION
   * Try to login with the given credentials
   */

  const tryLogin = async () => {
    if (isValidEmail(email)) {
      await fetch(cloud_url + "/api/v1/user/signin", {
        method: "POST",
        headers: {
          Accept: "application/json",
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          email: email,
          password: password,
        }),
      })
        .then((response) => {
          console.log(JSON.stringify(response));
          if (response.status !== 200) {
            throw Error(
              "No account found with the given credentials. Try again!"
            );
          }
          return response.json();
        })
        .then((json) => {
          console.log(json);
          storeToken(json.access_token);
          navigation.navigate("ListPage");
        })
        .catch((error) => console.error(error));
    } else {
      alert("You have entered invalid email. Try again!");
    }
  };

  return (
    <SafeAreaView style={styles.container}>
      <Image
        source={require("../../assets/images/icon.png")}
        style={styles.image}
      />
      <StatusBar style="auto" />
      <Text style={styles.text}>E-mail</Text>
      <SafeAreaView style={styles.inputView}>
        <TextInput
          style={styles.TextInput}
          onChangeText={(email) => setEmail(email)}
        />
      </SafeAreaView>
      <Text style={styles.text}>Password</Text>
      <SafeAreaView style={styles.inputView}>
        <TextInput
          style={styles.TextInput}
          secureTextEntry={true}
          onChangeText={(password) => setPassword(password)}
        />
      </SafeAreaView>

      <TouchableOpacity style={styles.loginBtn} onPress={tryLogin}>
        <Text style={[styles.whiteText]}>Sign In</Text>
      </TouchableOpacity>

      <TouchableOpacity style={styles.forgot_button}>
        <Text style={[styles.colorPurple, styles.mt]}>Forgot Password?</Text>
      </TouchableOpacity>
      <TouchableOpacity
        style={styles.forgot_button}
        onPress={() => navigation.navigate("Signup")}
      >
        <Text style={[styles.colorPurple, styles.mt]}>
          Don't have an account?
        </Text>
      </TouchableOpacity>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "",
    display: "flex",
    backgroundColor: "#fff",
  },
  colorPurple: {
    color: "#7F7E7E",
  },
  mt: {
    marginTop: "10%",
    fontSize: 18,
  },
  whiteText: {
    color: "white",
    fontSize: 18,
  },
  image: {
    alignContent: "center",
    top: "15%",
    width: 300,
    height: 200,
    left: "5%",
  },

  text: {
    top: "18.8%",
    left: "3%",
    fontSize: 20,
    fontWeight: "bold",
    color: "#5D54A4",
    textAlign: "left",
    left: "5%",
  },

  inputView: {
    backgroundColor: "#D9D9D9",
    top: "20%",
    borderRadius: 30,
    width: "90%",
    height: 45,
    marginBottom: 20,
    left: "5%",
  },

  TextInput: {
    height: 50,
    flex: 1,
    padding: 10,
    marginLeft: 20,
  },

  loginBtn: {
    width: "90%",
    borderRadius: 25,
    top: "22%",
    height: 50,
    alignItems: "center",
    justifyContent: "center",
    backgroundColor: "#5D54A4",
    left: "5%",
  },

  forgot_button: {
    width: "90%",
    top: "24%",
    alignItems: "center",
    justifyContent: "center",
    left: "5%",
  },

  signupBtn: {
    width: "80%",
    borderRadius: 25,
    top: "28%",
    height: 50,
    alignItems: "center",
    justifyContent: "center",
    backgroundColor: "#5D54A4",
    left: "9%",
  },
  text_signUp: {
    fontSize: 16,
    fontWeight: "bold",
    color: "#5D54A4",
    top: "26%",
    left: "5%",
  },
});

export default LoginPage;
